import React from "react";
import { ComposableMap, Geographies, Geography } from "react-simple-maps";

const Map = () => {
    const europeUrl = "https://cartomap.github.io/nl/wgs84/buurt_2024.geojson"

    return (
        <div className="w-full h-full flex justify-center items-center">
            <ComposableMap
                projectionConfig={{
                    scale: 250000, // Increased scale to zoom out
                    center: [4.9041, 52.3676], // Center map on Amsterdam (longitude, latitude)
                }}
                style={{width: "100%", height: "100%"}}
            >
                <Geographies geography={europeUrl}>
                    {({geographies}) =>
                        geographies.map((geo) => (
                            <Geography
                                key={geo.rsmKey}
                                geography={geo}
                                style={{
                                    default: {fill: "#D6D6DA", outline: "none"},
                                    hover: {fill: "#F53", outline: "none"},
                                    pressed: {fill: "#E42", outline: "none"},
                                }}
                            />
                        ))
                    }
                </Geographies>
            </ComposableMap>
        </div>
    );
}

export default Map;
